// import { DinerContext } from '../../Contexts/DinerContext'
import {useHistory} from 'react-router-dom'
// import axiosWithAuth from '../axiosWithAuth'
import '../../App.css'
import { Card2, Links, TruckButton } from '../../styled-components'


export default function TruckCard(props) {
    console.log(props)
    const {push} = useHistory();
// const [dinersList, dinerTrucks] = useContext(DinerContext)




    return (
        <Card2>
            <img className='truckImg' alt='truck' src={props.image}/>
            <div className='truckDetails2'>
            <h1>{props.name}</h1>
            <TruckButton className='truckBtn'>Add to Favorites</TruckButton>
            </div>
        </Card2>
    )
}
